import React from 'react';
import './Assets/css/responsive.css';
import { Switch, Route, Routes, BrowserRouter } from "react-router-dom";
import Header from './Layouts/Header.js';
import Footer from './Layouts/Footer.js';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.js';

import RouteLink from './RouteLink/RouteLink.js';
import Home from './Pages/Home/Home.js';
import Aboutus from './Pages/Aboutus/Aboutus.js';
import MotorCycles from './Pages/MotorCycles/MotorCycles.js';
import NFT_Listed from './Pages/NFT_Listed/NFT_Listed.js';
import Login from './Component/Auth/Login.js';
import Signup from './Component/Auth/Signup.js';
import NFT_Campaign from './Pages/NFT_Campaign/NFT_Campaign.js';
import NFT_Sale from './Pages/NFT_Sale/NFT_Sale.js';
import CreateNewWallet from "./Pages/CreateNewWallet/CreateNewWallet.js";
import Store from './Pages/Store/Store.js';
import Faq from "./Pages/Support/Support.js";
import Support from './Pages/Support/Support.js';
import Terms_Conditions from './Pages/Terms&Conditions/Terms&Conditions';




function App() {
  return (
    <>
      <Header></Header>

      <Routes>
        <Route exact path="/" element={<Home></Home>} />
        <Route exact path="/aboutus" element={<Aboutus></Aboutus>} />
        <Route
          exact
          path="/MotorCycles"
          element={<MotorCycles></MotorCycles>}
        />
        <Route exact path="/NFT_Listed" element={<NFT_Listed></NFT_Listed>} />
        <Route exact path="/Login" element={<Login></Login>} />
        <Route exact path="/Signup" element={<Signup></Signup>} />
        <Route
          exact
          path="/NFT_Campaign"
          element={<NFT_Campaign></NFT_Campaign>}
        />
        <Route exact path="/NFT_Sale" element={<NFT_Sale></NFT_Sale>} />
        <Route exact path="/Store" element={<Store></Store>} />
        <Route exact path="/Faq" element={<Faq></Faq>} />
        <Route exact path="/Terms&Conditions" element={<Terms_Conditions/>} />

        <Route exact path="/Support" element={<Support></Support>} />

        <Route
          exact
          path="/CreateNewWallet"
          element={<CreateNewWallet></CreateNewWallet>}
        />
      </Routes>

      <Footer></Footer>
    </>
  );
}
export default App;
